package leecode

// 输入: "cbbd"
//输出: "bb"
// Related Topics 字符串 动态规划

func longestPalindrome(s string) string {
	var result string
	for i := 0; i < len(s); i++ {
		var tempMax string
		if len(s) <= 1 {
			return s
		}
		tempMax = getMaxHuiWen(i, i, s)
		if len(tempMax) > len(result) {
			result = tempMax
		}
		if i+1 < len(s) && s[i] == s[i+1] { // "baab"
			tempMax = getMaxHuiWen(i, i+1, s)
			if len(tempMax) > len(result) {
				result = tempMax
			}
		}

		if len(s) > 0 && len(result) == 0 {
			result = s[0:1]
		}
	}
	return result
}

func getMaxHuiWen(i1 int, i2 int, s string) string {
	i := 0
	for i1-i >= 0 && i2+i < len(s) {
		if s[i1-i] == s[i2+i] {
			i++
		} else {
			return s[i1-i+1 : i2+i]
		}
	}
	if i == 0 {
		return s[i1 : i2+1]
	} else {
		return s[i1-i+1 : i2+i]
	}
}

